class ToggleLike{constructor(t){this.toggler=t,this.toggleLike()}toggleLike(){$(document).on("click",this.toggler,function(t){t.preventDefault();const o=$(this);t=o.attr("href");$.ajax({type:"POST",url:t}).done(function(t){let e=parseInt(o.attr("data-likes"));console.log(e),1==t.data.deleted?--e:e+=1,o.attr("data-likes",e),o.html(e+" Likes")}).fail(function(t){console.log("error in completing the request",t)})})}}